import logo from './logo.svg';
import './App.css';

<script src="https://unpkg.com/babel-standalone@6/babel.min.js"></script>

function App() {
    let numbers = []
    for (let i = 0; i < 10; i++) {
        numbers.push(Math.floor(Math.random() * 20))
    }
    return (
        <div className="container">
            <div className="chats">
                <table>
                {numbers.map(item => {return(
                    <tr>item</tr>
                )})}
                </table>
            </div>
        </div>
    );
}

export default App;
